beforeHooks.code:
const testName = this.currentTest.fullTitle()
await driverFactory.build(testName)
this.driver = driverFactory.driver

afterHooks.code:
if ((this.currentTest.state=='failed') || (this.currentTest.state=='passed')) {
  let imageFileName = this.currentTest.title+ '.jpeg';
  this.driver.takeScreenshot().then(
    function(image){
      require('fs').writeFileSync('./screenshots/'+ imageFileName, image, 'base64')
    }
  )
  addContext(this, 'Screen shot where the test case ended')
  addContext(this,'../screenshots/'+ imageFileName)
}

